piranha.navigation=piranha.navigation||{},piranha.navigation.menuList=new Vue({el:"#menulist",data:{loading:!0,items:[]},methods:{bind:function(n){this.items=n.menus},load:function(){return fetch(piranha.baseUrl+"manager/api/navigation/menus/list").then(n=>n.json()).then(n=>{this.bind(n),this.loading=!1}).catch(n=>{console.log("error:",n)})},remove:function(n){}},created:function(){}});